, '', 'formulario-login', '', '', '2022-12-10 03:13:36', '2022-12-10 02:13:36', '', 0, 'https://test86.weloveweb.eu/?post_type=wpcf7_contact_form&#038;p=93', 0, 'wpcf7_contact_form', '', 0),
(100, 1, '2022-12-10 03:35:45', '2022-12-10 02:35:45', '<div class=\"summary\">\r\n\r\nLas Islas Baleares estrenará la primera red de carga bidireccional para coches eléctricos, la cual estará promovida por ACCIONA Energía. Inicialmente se presenta como un proyecto piloto con el que analizar su impacto y uso para una posible expansión a otros puntos del país.\r\n\r\n</div>\r\n<div class=\"content-info\"></div>', 'La primera red de carga bidireccional de España', '', 'publish', 'closed', 'closed', '', 'la-primera-red-de-carga-bidireccional-de-espana', '', '', '2022-12-10 03:35:45', '2022-12-10 02:35:45', '', 0, 'https://test86.weloveweb.eu/?post_type=cpt_noticias&#038;p=100', 0, 'cpt_noticias', '', 0),
