(102, 1, '2022-12-10 03:39:18', '2022-12-10 02:39:18', '<div class=\"summary\">\r\n\r\nEuropa busca la integración segura de los vehículos aéreos en entornos urbanos. Por ello, EHang se ha unido al proyecto SAMVA por el que mejorarán el control satelital de las aeronaves del futuro. El centro operativo estará asentado en el aeropuerto de Lleida-Alguaire.\r\n\r\n</div>\r\n<div class=\"content-info\"></div>\r\n<div></div>\r\n<div></div>\r\n<div></div>', 'El eVTOL de EHang, desarrollado en España', '', 'publish', 'closed', 'closed', '', 'el-evtol-de-ehang-desarrollado-en-espana', '', '', '2022-12-10 07:25:57', '2022-12-10 06:25:57', '', 0, 'https://test86.weloveweb.eu/?post_type=cpt_noticias&#038;p=102', 0, 'cpt_noticias', '', 0),
