(104, 1, '2022-12-10 03:41:40', '2022-12-10 02:41:40', '<div class=\"summary\">\r\n\r\nLos nuevos fabricantes de baterías europeos y estadounidenses destinadas a vehículos eléctricos tratan de reducir el dominio de China desarrollando materiales alternativos, más baratos y que además alivian los cuellos de botella del suministro.\r\n\r\n</div>\r\n<div class=\"content-info\"></div>', 'Europa y EE.UU. desarrollan nuevas químicas de batería', '', 'publish', 'closed', 'closed', '', 'europa-y-ee-uu-desarrollan-nuevas-quimicas-de-bateria', '', '', '2022-12-10 03:41:40', '2022-12-10 02:41:40', '', 0, 'https://test86.weloveweb.eu/?post_type=cpt_noticias&#038;p=104', 0, 'cpt_noticias', '', 0),
