(108, 1, '2022-12-10 04:29:29', '2022-12-10 03:29:29', '<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\", onclick=\"clicked();\"><a class=\"wp-block-button__link wp-element-button\">alert</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\n\n<!-- wp:html -->\n<button onclick=\"clicked();\">Press me</button>\n<!-- /wp:html -->\n\n<!-- wp:shortcode -->\n[wr_shortcode_citation post_id=\"102\"] \n<!-- /wp:shortcode -->', '', '', 'inherit', 'closed', 'closed', '', '73-revision-v1', '', '', '2022-12-10 04:29:29', '2022-12-10 03:29:29', '', 73, 'https://test86.weloveweb.eu/?p=108', 0, 'revision', '', 0),
