(110, 1, '2022-12-10 07:16:28', '2022-12-10 06:16:28', '<div class=\"summary\">\n\nEuropa busca la integración segura de los vehículos aéreos en entornos urbanos. Por ello, EHang se ha unido al proyecto SAMVA por el que mejorarán el control satelital de las aeronaves del futuro. El centro operativo estará asentado en el aeropuerto de Lleida-Alguaire.\n\n</div>\n<div class=\"content-info\">[noticias id=\"102\"]</div>\n<div></div>\n<div></div>\n<div></div>\n\n\n\n', 'El eVTOL de EHang, desarrollado en España', '', 'inherit', 'closed', 'closed', '', '102-autosave-v1', '', '', '2022-12-10 07:16:28', '2022-12-10 06:16:28', '', 102, 'https://test86.weloveweb.eu/?p=110', 0, 'revision', '', 0),
(111, 1, '2022-12-10 07:11:20', '2022-12-10 06:11:20', '{\n    \"custom_css[tecnic]\": {\n        \"value\": \"/* styling contact form 7 with custom CSS */\\ndiv#wpcf7-f9-p35-o1 {\\n    background-color: #FFF;\\n    padding: 20px;\\n    border-radius: 5px;\\n}\\ndiv#wpcf7-f9-p35-o1 input,\\ndiv#wpcf7-f9-p35-o1 textarea {\\n    background-color: transparent !important;\\n    border: none !important;\\n    border-bottom: 1px solid #b2adad !important;\\n}\\ndiv#wpcf7-f9-p35-o1 label {\\n    color: #b2adad;\\n}\\ndiv#wpcf7-f9-p35-o1 input[type=\\\"submit\\\"] {\\n    background-image: -o-linear-gradient( 45deg, #436684, #436684 );\\n    background-image: linear-gradient( 45deg, #436684, #436684 );\\n\\tcolor: white;\\n    display: block;\\n    max-width: 50%;\\n    margin: 0 auto;\\n    padding: 1em 4em;\\n}\\nbody.page-id-35 .post-inner.thin {\\n    background-image: -o-linear-gradient( 45deg, #436684, transparent );\\n    background-image: linear-gradient( 45deg, #436684, transparent );\\n    padding-bottom: 2em;\\n}\\n\\ninput.wpcf7-form-control.wpcf7-text.wpcf7-tel.wpcf7-validates-as-tel {\\n    width: 100%;\\n}\\n\\ninput.wpcf7-form-control.wpcf7-text.wpcf7-email.wpcf7-validates-as-required.wpcf7-validates-as-email.required {\\n    width: 100%;\\n}\\n\\ninput.wpcf7-form-control.wpcf7-text.wpcf7-validates-as-required.required {\\n\\twidth: 100%;\\n}\\n\",\n        \"type\": \"custom_css\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-12-10 06:11:20\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', 'df1e0590-04d7-4127-ac72-18295de16918', '', '', '2022-12-10 07:11:20', '2022-12-10 06:11:20', '', 0, 'https://test86.weloveweb.eu/df1e0590-04d7-4127-ac72-18295de16918/', 0, 'customize_changeset', '', 0),
