INSERT INTO `wp_snippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`) VALUES
(10, 'remove toolbar items ', '', 'function shapeSpace_remove_toolbar_nodes($wp_admin_bar) {\r\n	\r\n	$wp_admin_bar->remove_node(\'wp-logo\');\r\n	$wp_admin_bar->remove_node(\'comments\');\r\n	$wp_admin_bar->remove_node(\'customize\');\r\n	$wp_admin_bar->remove_node(\'customize-background\');\r\n	$wp_admin_bar->remove_node(\'customize-header\');\r\n	$wp_admin_bar->remove_node(\'profile\');\r\n	$wp_admin_bar->remove_node(\'updates\');\r\n    $wp_admin_bar->remove_node(\'new-content\');\r\n	$wp_admin_bar->remove_node(\'search\');\r\n	$wp_admin_bar->remove_node(\'edit\');\r\n\r\n}\r\nadd_action(\'admin_bar_menu\', \'shapeSpace_remove_toolbar_nodes\', 100);', '', 'global', 1, 1, '2022-12-10 18:41:12'),
(6, 'assign default profile image', '', 'add_filter( \'avatar_defaults\', \'sp_gravatar\' );\r\n\r\nfunction sp_gravatar ($avatar) {\r\n     $nuevoAvatar = get_template_directory_uri() . \'/img/logo.webp\';\r\n     $avatar[$nuevoAvatar] = \"Gravatar default\";\r\n     return $avatar;\r\n}', '', 'global', 10, 1, '2022-12-10 17:34:39'),
(5, 'eliminar notificaciones de plugins y temas ', '', 'function hide_notices_dashboard() {\r\n    global $wp_filter;\r\n\r\n    if ( is_network_admin() and isset($wp_filter[\'network_admin_notices\']) ) {\r\n        unset( $wp_filter[\'network_admin_notices\'] );\r\n    } elseif( is_user_admin() && isset($wp_filter[\'user_admin_notices\']) ) {\r\n        unset( $wp_filter[\'user_admin_notices\'] );\r\n    } else {\r\n        if ( isset($wp_filter[\'admin_notices\']) ) {\r\n            unset( $wp_filter[\'admin_notices\'] );\r\n        }\r\n    }\r\n\r\n    if ( isset($wp_filter[\'all_admin_notices\']) ) {\r\n        unset( $wp_filter[\'all_admin_notices\'] );\r\n    }\r\n}\r\nadd_action( \'admin_init\', \'hide_notices_dashboard\' );', '', 'global', 10, 1, '2022-12-08 21:42:34'),
(8, 'Change login logo & colors', '', 'function my_custom_login(){\r\n	echo \'<link rel=\"stylesheet\" type=\"text/css\" href=\"\' . get_bloginfo(\'stylesheet_directory\') . \'/custom-login-style.css\" />\';\r\n}\r\nadd_action(\'login_head\', \'my_custom_login\');\r\n\r\nfunction custom_login_logo_url() {\r\n	return get_bloginfo( \'url\' );\r\n}\r\nadd_filter( \'login_headerurl\', \'custom_login_logo_url\' );\r\n\r\nfunction custom_login_logo_url_title() {\r\n	return \'Tecnic\';\r\n}\r\nadd_filter( \'login_headertitle\', \'custom_login_logo_url_title\' );\r\n\r\nfunction custom_login_error_message(){\r\n	return \'Por favor ingrese las credenciales correctas\';\r\n}\r\nadd_filter(\'login_errors\', \'custom_login_error_message\');\r\n\r\n\r\nfunction custom_login_head() {\r\n	remove_action(\'login_head\', \'wp_shake_js\', 12);\r\n}\r\nadd_action(\'login_head\', \'custom_login_head\');\r\n\r\n\r\nfunction custom_login_redirect( $redirect_to, $request, $user ){\r\n	global $user;\r\n	if( isset( $user->roles ) && is_array( $user->roles ) ) {\r\n		if( in_array( \"administrator\", $user->roles ) ) {\r\n			return $redirect_to;\r\n		} else {\r\n			return home_url();\r\n		}\r\n	}\r\n	else{\r\n		return $redirect_to;\r\n	}\r\n}\r\nadd_filter(\"login_redirect\", \"custom_login_redirect\", 10, 3);\r\n\r\n\r\nadd_filter( \'login_display_language_dropdown\', \'__return_false\' );', '', 'global', 10, 1, '2022-12-08 23:21:10'),
(9, 'Color Dasboard WP', '', '\r\nfunction wpacg_colortecnic_admin_color_scheme() {\r\n  //Get the theme directory\r\n  $theme_dir = get_stylesheet_directory_uri();\r\n\r\n  //color-tecnic\r\n  wp_admin_css_color( \'colortecnic\', __( \'color-tecnic\' ),\r\n    $theme_dir . \'/colortecnic.css\',\r\n    array( \'#0d2831\', \'#e5f8ff\', \'#e1a948\' , \'#436684\')\r\n  );\r\n}\r\nadd_action(\'admin_init\', \'wpacg_colortecnic_admin_color_scheme\');', '', 'global', 10, 1, '2022-12-08 22:25:48'),
(11, 'Remove menus dashboard', '', 'function wpdocs_remove_menus(){\r\n	remove_menu_page( \'index.php\' );                    //Dashboard\r\n	remove_menu_page( \'edit.php\' );                     //Posts\r\n	remove_menu_page( \'users.php\' );                    //users\r\n	remove_menu_page( \'edit.php?post_type=popup\' );                    //\r\n\r\n	\r\n	if( ! current_user_can( \'administrator\' ) && ! current_user_can( \'editor\') ){\r\n		remove_submenu_page( \'edit.php?post_type=cpt_noticias\', \'post-new.php?post_type=cpt_noticias\' );\r\n	} \r\n}\r\nadd_action( \'admin_menu\', \'wpdocs_remove_menus\', 999 );', '', 'global', 10, 1, '2022-12-10 18:44:57'),
(15, 'Shortcode Noticias', '', '////shortcode | para los plugin es recomendable inicializarlo sólo después de que WordPress se haya cargado completamente. Puede asegurarse de ello envolviendo la función add_shortcode() dentro de otra función. Esto se llama una función de envoltura:\r\n////$descripcion = get_the_content($atts[\'id\']);\r\n\r\nfunction shortcodes_init(){\r\n	\r\n	function shortcode_handler_function( $atts ){\r\n		\r\n		global $post;\r\n		  $atts = shortcode_atts ( array (\r\n			  \'id\' => $post->ID\r\n		  ), $atts );\r\n		\r\n		$titulo = get_the_title($atts[\'id\']);\r\n			$post_content = get_post($atts[\'id\']);\r\n		$descripcion = $post_content->post_content;\r\n		$autor = get_field( \"autor\", $atts[\'id\'] );\r\n		$fecha = get_field( \"fecha\", $atts[\'id\'] );\r\n		$imagen = get_field( \"imagen\", $atts[\'id\'] );\r\n\r\n		\r\n			return $descripcion;\r\n	}\r\n	\r\n add_shortcode( \'noticias\', \'shortcode_handler_function\' );\r\n}\r\nadd_action(\'init\', \'shortcodes_init\');\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', 'global', 1, 0, '2022-12-10 18:17:05'),
(13, 'CPT Noticias', '', 'if ( ! function_exists(\'ft_cpt_noticias\') ) {\r\n\r\n// Register Custom Post Type\r\nfunction ft_cpt_noticias() {\r\n\r\n	$labels = array(\r\n		\'name\'                  => _x( \'Noticias\', \'Post Type General Name\', \'text_domain\' ),\r\n		\'singular_name\'         => _x( \'Noticia\', \'Post Type Singular Name\', \'text_domain\' ),\r\n		\'menu_name\'             => __( \'Noticias\', \'text_domain\' ),\r\n		\'name_admin_bar\'        => __( \'Post Type\', \'text_domain\' ),\r\n		\'archives\'              => __( \'Item Archives\', \'text_domain\' ),\r\n		\'attributes\'            => __( \'Item Attributes\', \'text_domain\' ),\r\n		\'parent_item_colon\'     => __( \'Parent Item:\', \'text_domain\' ),\r\n		\'all_items\'             => __( \'Mostrar todas\', \'text_domain\' ),\r\n		\'add_new_item\'          => __( \'Add New Item\', \'text_domain\' ),\r\n		\'add_new\'               => __( \'Añadir nueva\', \'text_domain\' ),\r\n		\'new_item\'              => __( \'New Item\', \'text_domain\' ),\r\n		\'edit_item\'             => __( \'Edit Item\', \'text_domain\' ),\r\n		\'update_item\'           => __( \'Update Item\', \'text_domain\' ),\r\n		\'view_item\'             => __( \'View Item\', \'text_domain\' ),\r\n		\'view_items\'            => __( \'View Items\', \'text_domain\' ),\r\n		\'search_items\'          => __( \'Search Item\', \'text_domain\' ),\r\n		\'not_found\'             => __( \'Not found\', \'text_domain\' ),\r\n		\'not_found_in_trash\'    => __( \'Not found in Trash\', \'text_domain\' ),\r\n		\'featured_image\'        => __( \'Featured Image\', \'text_domain\' ),\r\n		\'set_featured_image\'    => __( \'Set featured image\', \'text_domain\' ),\r\n		\'remove_featured_image\' => __( \'Remove featured image\', \'text_domain\' ),\r\n		\'use_featured_image\'    => __( \'Use as featured image\', \'text_domain\' ),\r\n		\'insert_into_item\'      => __( \'Insert into item\', \'text_domain\' ),\r\n		\'uploaded_to_this_item\' => __( \'Uploaded to this item\', \'text_domain\' ),\r\n		\'items_list\'            => __( \'Items list\', \'text_domain\' ),\r\n		\'items_list_navigation\' => __( \'Items list navigation\', \'text_domain\' ),\r\n		\'filter_items_list\'     => __( \'Filter items list\', \'text_domain\' ),\r\n	);\r\n	$rewrite = array(\r\n		\'slug\'                  => \'noticias\',\r\n		\'with_front\'            => true,\r\n		\'pages\'                 => true,\r\n		\'feeds\'                 => true,\r\n	);\r\n	$args = array(\r\n		\'label\'                 => __( \'Noticia\', \'text_domain\' ),\r\n		\'description\'           => __( \'Noticias Tecnic\', \'text_domain\' ),\r\n		\'labels\'                => $labels,\r\n		\'supports\'              => array( \'title\', \'editor\' ),\r\n		\'hierarchical\'          => false,\r\n		\'public\'                => true,\r\n		\'show_ui\'               => true,\r\n		\'show_in_menu\'          => true,\r\n		\'menu_position\'         => 20,\r\n		\'menu_icon\'             => \'dashicons-format-aside\',\r\n		\'show_in_admin_bar\'     => false,\r\n		\'show_in_nav_menus\'     => true,\r\n		\'can_export\'            => true,\r\n		\'has_archive\'           => true,\r\n		\'exclude_from_search\'   => false,\r\n		\'publicly_queryable\'    => true,\r\n		\'rewrite\'               => $rewrite,\r\n		\'capability_type\'       => \'page\',\r\n	);\r\n	register_post_type( \'cpt_noticias\', $args );\r\n\r\n}\r\nadd_action( \'init\', \'ft_cpt_noticias\', 0 );\r\n\r\n}', '', 'global', 10, 1, '2022-12-09 18:43:04');
